import React from 'react';
import styles from './AdminSideMenu.module.css'; // CSS modülünü içe aktarın
import { Link } from 'react-router-dom';
import { AdminUrunEkle } from '../AdminUrunEkle/UrunEkle';
const SideMenu = () => {
  return (
    <div className={styles.sideMenu}>
      <ul>


        <li><Link to="/user-info" className={styles.link}>Kullanıcı Bilgileri</Link></li>
        <li><Link to="/admin-urunekle" className={styles.link}>Ürün Ekleme</Link></li>
        <li><Link to="/urunsil" className={styles.link}>Ürün Silme</Link></li>
        <li><Link to="/stokguncelle" className={styles.link}>Stok Güncelleme</Link></li>
        <li><Link to="/kayıtlıloglar" className={styles.link}>Kayıtlı Loglar</Link></li>
        <li><button className={styles.button}>Log Out</button></li>
      </ul>
    </div>
  );
};

export default SideMenu;
